import React from 'react';

const InstagramEmbed = ({ reelUrl }) => {
  return (
    <div style={{ position: 'relative', paddingBottom: '125%', height: 0, overflow: 'hidden', maxWidth: '100%', background: '#000', marginTop: '16px' }}>
      <iframe 
        src={`${reelUrl}embed`}
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          border: 'none',
          overflow: 'hidden',
        }}
        scrolling="no"
        allowTransparency="true"
        allow="encrypted-media"
      ></iframe>
    </div>
  );
};

export default InstagramEmbed;
